fields.featured_product:
        {% if product.lifestyle_image%}
        <style type='text/css'>
            .featured.product .image-div {
                width: 220px;
            }

            .featured.product .image-div .image {
                max-width: 220px;
                max-height: 220px;
            }
        </style>

        <div class='lifestyle cell'>
            <img class='image' src='{{ product.lifestyle_image }}' />
            <div class='description'>
                {{product.description|safe|linebreaks}}
            </div>
        </div>
        {% endif %}
        <div class='cell'>
            <!-- Main Display Area -->
            <div class='title text'><b>{{ product.name }}</b></div>
            <div class='table'>
                <div class="image-div">
                    <img class='image' src='{{ product.featured_image }}' />
                </div>
                <div class="info">
                    <div class='price text'>{{ product.price }}</div>
                    <div>
                        {% social_buttons product %}
                        <div class='spacer'></div>
                    </div>
                </div>
                <div class='text'><a href='{{ product.url }}' class='buy' target='_blank'>BUY NOW</a></div>
            </div>
        </div>

<div class='spacer'></div>

